url\":\"/api/media/file/changelog-pi-desktop-light-1200x630.webp\"}},\"id\":\"68c7f95bbe10ec5b60c27387\",\"url\":\"/api/media/file/changelog-pi-desktop-light.webp\",\"thumbnailURL\":\"/api/media/file/changelog-pi-desktop-light-300x169.webp\"}},{\"children\":[{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Talk through ideas naturally—Pi turns rough thoughts into clear documents, PRDs, or proposals, and surfaces summaries, blockers, and next steps from your workspace context. Capture ideas instantly and turn brainstorming into structured documentation without losing the reasoning behind decisions.\",\"type\":\"text\",\"version\":1},{\"type\":\"linebreak\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"paragraph\",\"version\":1,\"textFormat\":0,\"textStyle\":\"\"},{\"children\":[{\"detail\":0,\"format\":1,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Bring External Embeds into your work\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"heading\",\"version\":1,\"textFormat\":1,\"tag\":\"h3\"},{\"children\":[{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"You can now drop Figma files, Loom videos, YouTube links, Google Docs, spreadsheets, and hundreds of other embeds right into your work items, pages, epics, initiatives, and cycles.\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"paragraph\",\"version\":1,\"textFormat\":0,\"textStyle\":\"\"},{\"type\":\"upload\",\"version\":3,\"format\":\"\",\"id\":\"68c7f9b85d6edc5c41792f49\",\"fields\":null,\"relationTo\":\"media\",\"value\":{\"createdAt\":\"2025-09-15T11:32:17.135Z\",\"updatedAt\":\"2025-09-15T11:32:17.135Z\",\"alt\":\"changelog-embed-1-desktop-light.webp\",\"filename\":\"changelog-embed-1-desktop-light.webp\",\"mimeType\":\"image/webp\",\"filesize\":145804,\"width\":4445,\"height\":2500,\"focalX\":50,\"focalY\":50,\"sizes\":{\"thumbnail\":{\"width\":300,\"height\":169,\"mimeType\":\"image/webp\",\"filesize\":3296,\"filename\":\"changelog-embed-1-desktop-light-300x169.webp\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light-300x169.webp\"},\"square\":{\"width\":500,\"height\":500,\"mimeType\":\"image/webp\",\"filesize\":16250,\"filename\":\"changelog-embed-1-desktop-light-500x500.webp\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light-500x500.webp\"},\"small\":{\"width\":600,\"height\":337,\"mimeType\":\"image/webp\",\"filesize\":11748,\"filename\":\"changelog-embed-1-desktop-light-600x337.webp\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light-600x337.webp\"},\"medium\":{\"width\":900,\"height\":506,\"mimeType\":\"image/webp\",\"filesize\":22252,\"filename\":\"changelog-embed-1-desktop-light-900x506.webp\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light-900x506.webp\"},\"large\":{\"width\":1400,\"height\":787,\"mimeType\":\"image/webp\",\"filesize\":40766,\"filename\":\"changelog-embed-1-desktop-light-1400x787.webp\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light-1400x787.webp\"},\"xlarge\":{\"width\":1920,\"height\":1080,\"mimeType\":\"image/webp\",\"filesize\":60088,\"filename\":\"changelog-embed-1-desktop-light-1920x1080.webp\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light-1920x1080.webp\"},\"og\":{\"width\":1200,\"height\":630,\"mimeType\":\"image/webp\",\"filesize\":30990,\"filename\":\"changelog-embed-1-desktop-light-1200x630.webp\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light-1200x630.webp\"}},\"id\":\"68c7f941be10ec5b60c27373\",\"url\":\"/api/media/file/changelog-embed-1-desktop-light.webp\",\"thumbnailURL\":\"/api/media/file/changelog-embed-1-desktop-light-300x169.webp\"}},{\"children\":[{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Instead of pasting static links, your specs, notes, and docs can show live content that stays in context. For example, embed a Figma file and edit it directly in Plane if you’re logged into the same account—no more flipping between tabs.\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"paragraph\",\"version\":1,\"textFormat\":0,\"textStyle\":\"\"},{\"type\":\"upload\",\"version\":3,\"format\":\"\",\"id\":\"68c7f9c85d6edc5c41792f4a\",\"fields\":null,\"relationTo\":\"media\",\"value\":{\"createdAt\":\"2025-09-15T11:32:26.068Z\",\"updatedAt\":\"2025-09-15T11:32:26.068Z\",\"alt\":\"changelog-embed-2-desktop-light.webp\",\"filename\":\"changelog-embed-2-desktop-light.webp\",\"mimeType\":\"image/webp\",\"filesize\":146568,\"width\":4445,\"height\":2500,\"focalX\":50,\"focalY\":50,\"sizes\":{\"thumbnail\":{\"width\":300,\"height\":169,\"mimeType\":\"image/webp\",\"filesize\":3502,\"filename\":\"changelog-embed-2-desktop-light-300x169.webp\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light-300x169.webp\"},\"square\":{\"width\":500,\"height\":500,\"mimeType\":\"image/webp\",\"filesize\":18278,\"filename\":\"changelog-embed-2-desktop-light-500x500.webp\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light-500x500.webp\"},\"small\":{\"width\":600,\"height\":337,\"mimeType\":\"image/webp\",\"filesize\":12578,\"filename\":\"changelog-embed-2-desktop-light-600x337.webp\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light-600x337.webp\"},\"medium\":{\"width\":900,\"height\":506,\"mimeType\":\"image/webp\",\"filesize\":23266,\"filename\":\"changelog-embed-2-desktop-light-900x506.webp\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light-900x506.webp\"},\"large\":{\"width\":1400,\"height\":787,\"mimeType\":\"image/webp\",\"filesize\":43104,\"filename\":\"changelog-embed-2-desktop-light-1400x787.webp\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light-1400x787.webp\"},\"xlarge\":{\"width\":1920,\"height\":1080,\"mimeType\":\"image/webp\",\"filesize\":60146,\"filename\":\"changelog-embed-2-desktop-light-1920x1080.webp\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light-1920x1080.webp\"},\"og\":{\"width\":1200,\"height\":630,\"mimeType\":\"image/webp\",\"filesize\":33730,\"filename\":\"changelog-embed-2-desktop-light-1200x630.webp\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light-1200x630.webp\"}},\"id\":\"68c7f94abe10ec5b60c27379\",\"url\":\"/api/media/file/changelog-embed-2-desktop-light.webp\",\"thumbnailURL\":\"/api/media/file/changelog-embed-2-desktop-light-300x169.webp\"}},{\"children\":[{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Every embed comes with flexible controls: zoom in and out, switch to a preview card, or roll back to a plain link. That means your team can review designs, watch demos, and check docs without breaking flow.\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"paragraph\",\"version\":1,\"textFormat\":0,\"textStyle\":\"\"},{\"children\":[{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Link Slack conversations to existing work items\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"heading\",\"version\":1,\"tag\":\"h3\"},{\"children\":[{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"You can now connect any Slack message or thread to a relevant work item to preserve the context between conversations and actual work. This means when a customer reports a bug in your support channel, or when your team discusses a feature request, you can link that conversation directly to the work item tracking it. Comments sync bidirectionally between the linked Slack thread and the work item, so everyone stays informed regardless of where they prefer to work.\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"paragraph\",\"version\":1,\"textFormat\":0,\"textStyle\":\"\"},{\"type\":\"upload\",\"version\":3,\"format\":\"\",\"id\":\"68c7f9ee5d6edc5c41792f4b\",\"fields\":null,\"relationTo\":\"media\",\"value\":{\"createdAt\":\"2025-09-15T11:33:00.088Z\",\"updatedAt\":\"2025-09-15T11:33:00.088Z\",\"alt\":\"changelog-slack-1-desktop-light.webp\",\"filename\":\"changelog-slack-1-desktop-light.webp\",\"mimeType\":\"image/webp\",\"filesize\":140414,\"width\":4445,\"height\":2500,\"focalX\":50,\"focalY\":50,\"sizes\":{\"thumbnail\":{\"width\":300,\"height\":169,\"mimeType\":\"image/webp\",\"filesize\":3238,\"filename\":\"changelog-slack-1-desktop-light-300x169.webp\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light-300x169.webp\"},\"square\":{\"width\":500,\"height\":500,\"mimeType\":\"image/webp\",\"filesize\":19284,\"filename\":\"changelog-slack-1-desktop-light-500x500.webp\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light-500x500.webp\"},\"small\":{\"width\":600,\"height\":337,\"mimeType\":\"image/webp\",\"filesize\":10878,\"filename\":\"changelog-slack-1-desktop-light-600x337.webp\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light-600x337.webp\"},\"medium\":{\"width\":900,\"height\":506,\"mimeType\":\"image/webp\",\"filesize\":20654,\"filename\":\"changelog-slack-1-desktop-light-900x506.webp\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light-900x506.webp\"},\"large\":{\"width\":1400,\"height\":787,\"mimeType\":\"image/webp\",\"filesize\":38968,\"filename\":\"changelog-slack-1-desktop-light-1400x787.webp\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light-1400x787.webp\"},\"xlarge\":{\"width\":1920,\"height\":1080,\"mimeType\":\"image/webp\",\"filesize\":55876,\"filename\":\"changelog-slack-1-desktop-light-1920x1080.webp\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light-1920x1080.webp\"},\"og\":{\"width\":1200,\"height\":630,\"mimeType\":\"image/webp\",\"filesize\":29426,\"filename\":\"changelog-slack-1-desktop-light-1200x630.webp\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light-1200x630.webp\"}},\"id\":\"68c7f96cbe10ec5b60c27392\",\"url\":\"/api/media/file/changelog-slack-1-desktop-light.webp\",\"thumbnailURL\":\"/api/media/file/changelog-slack-1-desktop-light-300x169.webp\"}},{\"children\":[{\"type\":\"linebreak\",\"version\":1},{\"detail\":0,\"format\":1,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Project specific alerts.\",\"type\":\"text\",\"version\":1},{\"type\":\"linebreak\",\"version\":1},{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"When you create or update work items, your entire team gets notified in a channel that linked to a specific project, so everyone knows what's being worked on without having to check Plane constantly.\",\"type\":\"text\",\"version\":1},{\"type\":\"linebreak\",\"version\":1},{\"type\":\"linebreak\",\"version\":1},{\"detail\":0,\"format\":1,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Thread specific alerts.\",\"type\":\"text\",\"version\":1},{\"type\":\"linebreak\",\"version\":1},{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"For cross-team collaboration, people involved in specific threads get status updates regardless of which project or team they're on—teams can work independently while staying informed about work that affects them.\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"paragraph\",\"version\":1,\"textFormat\":1,\"textStyle\":\"\"},{\"type\":\"upload\",\"version\":3,\"format\":\"\",\"id\":\"68c7fa035d6edc5c41792f4c\",\"fields\":null,\"relationTo\":\"media\",\"value\":{\"createdAt\":\"2025-09-15T11:33:08.553Z\",\"updatedAt\":\"2025-09-15T11:33:08.553Z\",\"alt\":\"changelog-slack-2-desktop-light.webp\",\"filename\":\"changelog-slack-2-desktop-light.webp\",\"mimeType\":\"image/webp\",\"filesize\":132928,\"width\":4445,\"height\":2500,\"focalX\":50,\"focalY\":50,\"sizes\":{\"thumbnail\":{\"width\":300,\"height\":169,\"mimeType\":\"image/webp\",\"filesize\":3238,\"filename\":\"changelog-slack-2-desktop-light-300x169.webp\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light-300x169.webp\"},\"square\":{\"width\":500,\"height\":500,\"mimeType\":\"image/webp\",\"filesize\":18770,\"filename\":\"changelog-slack-2-desktop-light-500x500.webp\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light-500x500.webp\"},\"small\":{\"width\":600,\"height\":337,\"mimeType\":\"image/webp\",\"filesize\":10788,\"filename\":\"changelog-slack-2-desktop-light-600x337.webp\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light-600x337.webp\"},\"medium\":{\"width\":900,\"height\":506,\"mimeType\":\"image/webp\",\"filesize\":19790,\"filename\":\"changelog-slack-2-desktop-light-900x506.webp\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light-900x506.webp\"},\"large\":{\"width\":1400,\"height\":787,\"mimeType\":\"image/webp\",\"filesize\":37120,\"filename\":\"changelog-slack-2-desktop-light-1400x787.webp\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light-1400x787.webp\"},\"xlarge\":{\"width\":1920,\"height\":1080,\"mimeType\":\"image/webp\",\"filesize\":54412,\"filename\":\"changelog-slack-2-desktop-light-1920x1080.webp\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light-1920x1080.webp\"},\"og\":{\"width\":1200,\"height\":630,\"mimeType\":\"image/webp\",\"filesize\":29094,\"filename\":\"changelog-slack-2-desktop-light-1200x630.webp\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light-1200x630.webp\"}},\"id\":\"68c7f974be10ec5b60c27396\",\"url\":\"/api/media/file/changelog-slack-2-desktop-light.webp\",\"thumbnailURL\":\"/api/media/file/changelog-slack-2-desktop-light-300x169.webp\"}},{\"children\":[{\"type\":\"linebreak\",\"version\":1},{\"detail\":0,\"format\":1,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Personal alert on DM.\",\"type\":\"text\",\"version\":1},{\"type\":\"linebreak\",\"version\":1},{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Get direct message alerts for Plane updates where you're involved, regardless of project. Since most team communication happens in Slack anyway, these personal notifications ensure you stay in the loop with your work.\",\"type\":\"text\",\"version\":1},{\"type\":\"linebreak\",\"version\":1},{\"type\":\"linebreak\",\"version\":1},{\"detail\":0,\"format\":0,\"mode\":\"normal\",\"style\":\"\",\"text\":\"This eliminates the constant context switching that slows teams down and ensures that customer conversations, bug reports, and feature discussions stay connected to the actual work being done.\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"paragraph\",\"version\":1,\"textFormat\":1,\"textStyle\":\"\"},{\"children\":[{\"detail\":0,\"format\":1,\"mode\":\"normal\",\"style\":\"\",\"text\":\"Get notified when you're added to shared pages\",\"type\":\"text\",\"version\":1}],\"direction\":\"ltr\",\"format\":\"\",\"indent\":0,\"type\":\"heading\",\"version\":1,\"textFormat\":1,\"tag\":\"h3\"},{\"type\":\"upload\",\"version\":3,\"format\":\"\",\"id\":\"68c7fa1f5d6edc5c41792f4d\",\"fields\":null,\"relationTo\":\"media\",\"value\":{\"createdAt\":\"2025-09-15T11:32:51.453Z\",\"updatedAt\":\"2025-09-15T11:32:51.453Z\",\"alt\":\"changelog-shared-page-desktop-light.webp\",\"filename\":\"changelog-shared-page-desktop-light.webp\",\"mimeType\":\"image/webp\",\"filesize\":110432,\"width\":4445,\"height\":2500,\"focalX\":50,\"focalY\":50,\"sizes\":{\"thumbnail\":{\"width\":300,\"height\":169,\"mimeType\":\"image/webp\",\"filesize\":3008,\"filename\":\"changelog-shared-page-desktop-light-300x169.webp\",\"url\":\"/api/media/file/changelog-shared-page-desktop-light-300x169.webp\"},\"square\":{\"width\":500,\"height\":500,\"mimeType\":\"image/webp\",\"filesize\":11156,\"filename\":\"changelog-shared-page-desktop-light-500x500.webp\",\"url\":\"/api/media/file/changelog-shared-page-desktop-light-500x500.webp\"},\"small\":{\"width\":600,\"height\":337,\"mimeType\":\"image/webp\",\"filesize\":10152,\"filename\":\"changelog-shared-page-desktop-light-600x337.webp\",\"url\":\"/api/media/file/changelog-shared-page-